properties.code:
/**
	Removes a segment if all sections/fields are empty or contain empty quotes<br/><br/>
	e.g. filterSegment("AL1")

	@param {String} segmentName - The segment name to filter
*/
function filterSegment(segmentName) {
	var StringUtils = Packages.org.apache.commons.lang3.StringUtils;

	if(StringUtils.isNotBlank(segmentName) && msg[segmentName] != null && typeof msg[segmentName] != 'undefined') {
		var segmentLength = msg[segmentName].length();

		for(var segIdx = segmentLength - 1; segIdx >= 0; segIdx--) {
			var children = msg[segmentName][segIdx].children();
			var isEmpty = true;

			for each(section in children) {
				var sectionValue = section[section.localName() + ".1"].toString();

				if(StringUtils.isNotBlank(sectionValue) && sectionValue != '""' && sectionValue != "''") {
					isEmpty = false;
				}
			}

			if(isEmpty) {
				delete msg[segmentName][segIdx];
			}
		}
	}
}

